import "./navbar.scss"
import HomeRoundedIcon from '@mui/icons-material/HomeRounded';
import NightsStayTwoToneIcon from '@mui/icons-material/NightsStayTwoTone';
import MoreVertIcon from '@mui/icons-material/MoreVert';
import SearchOutlinedIcon from '@mui/icons-material/SearchOutlined';
import PersonRoundedIcon from '@mui/icons-material/PersonRounded';
import EmailRoundedIcon from '@mui/icons-material/EmailRounded';
import NotificationImportantRoundedIcon from '@mui/icons-material/NotificationImportantRounded';
import AccountCircleTwoToneIcon from '@mui/icons-material/AccountCircleTwoTone';
import { Link } from "react-router-dom";


const Navbar = () => {
    return(
        <div className="navbar">
            <div className="left">
                <Link to="/" style={{textDecoration:"none"}}>
                </Link>
                <span>DOG PARK</span>
                <HomeRoundedIcon/>
                <NightsStayTwoToneIcon/>
                <MoreVertIcon/>
                <div className="search">
                    <SearchOutlinedIcon/>
                    <input type="text" placeholder="Search..."/>
                </div>
            </div>
            <div className="right">
                <PersonRoundedIcon/>
                <EmailRoundedIcon/>
                <NotificationImportantRoundedIcon/>
                <div className="user">
                    {/*<img src="https://images.pexels.com/photos/7755302/pexels-photo-7755302.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1" alt=""/>
                   */} <span>Michael "Air" Jordan</span>
                </div>
            </div>
        </div>
    )
}

export default Navbar
